                        color: "#4b290c",
                        borderTop: "1px dashed #929292",
                        borderLeft: "1px dashed #929292",
                      }}
                      class="ng-binding"
                    >
                      $Price
                    </td>
                    <td
                      style={{
                        padding: "5px",
                        height: "35px",
                        textAlign: "center",
                        color: "#4b290c",
                        borderTop: "1px dashed #929292",
                        borderLeft: "1px dashed #929292",
                      }}
                    >
                      Qty
                    </td>
                    <td
                      style={{
                        textAlign: "center",
                        color: "#4b290c",
                        borderTop: "1px dashed #929292",
                        borderLeft: "1px dashed #929292",
                        borderRight: "1px dashed #929292",
                      }}
                    >
                      <div style={{ paddingTop: "10px" }} class="ng-binding">
                        $0.00
                      </div>
                      <div
                        style={{ paddingTop: "10px", paddingBottom: "5px" }}
                      ></div>
                    </td>
                  </tr>

                  <tr
                    style={{
                      height: "35px",
                      color: "#4b290c",
                      fontWeight: "bold",
                      textAlign: "right",
                      borderTop: "1px dashed #929292",
                    }}
                  >
                    <td
                      style={{
                        textAlign: "right",
                        color: "#4b290c",
                        fontWeight: "bold",
                      }}
                    ></td>
                    <td
                      style={{
                        paddingTop: "5px",
                        height: "35px",
                        color: "#4b290c",
                        fontWeight: "bold",
                        textAlign: "center",
                      }}
                    >
                      &nbsp;
                    </td>
                    <td
                      style={{
                        height: "35px",
                        color: "#4b290c",
                        fontWeight: "bold",
                        textAlign: "right",
                      }}
                    >
                      Subtotal:
                    </td>
                    <td
                      style={{
                        height: "35px",
                        color: "#4b290c",
                        fontWeight: "bold",
                        textAlign: "center",
                      }}
                      class="ng-binding"
                    >
                      0.00
                    </td>
                  </tr>
                </tbody>
              </table>

              <div class="col-12 lightbrownCartBackground cartText formBorder pushToLeft">
                <div>
                  <p>Comments or Additional Information</p>
                </div>
                <div class="  lightbrownCartBackground cartText">
                  <p>
                    <textarea
                      rows="4"
                      cols="30"
                      name="noteInput"
                      id="noteInput"
                    >
                      Note
                    </textarea>
                  </p>
                </div>
              </div>

              <div class="col-12 lightbrownCartBackground cartText">
                <div class="pushToRight ">
                  <NavLink to="/Cart">
                    <img src={Back} class="pb-4 pt-1" alt=""></img>
                  </NavLink>
                  <input type="image" src={Checkout} alt="Submit" />
                </div>
              </div>
            </div>
          </form>
        </div>
      </section>
    </main>
  );
};
export default CheckoutPage;
